import React, {Component} from 'react'
import Header from "../_layouts/_includes/header/Header";
import Content from "../_layouts/_includes/content/Content";
import Background from "../_layouts/default/Background";
import Footer from "../_layouts/_includes/footer/Footer";
import styled from 'styled-components'


const SteamBackground = styled.div`
    position: relative;
    min-width: 950px;
    background-color: #000000;
    background-position: center top;
    background-repeat: no-repeat;
    background-image: url('https://steamcdn-a.akamaihd.net/steamcommunity/public/images/items/282760/4ee088bd6fdce882ea787242da79e01dfb150d77.jpg');
`


class ShowcaseContainer extends Component {

    constructor(props) {
        super(props)
        this.state = {}
    }

    render() {
        return (
            <>
                <Background>
                    <Header/>

                    <Content>
                    </Content>
                    <Footer />
                </Background>
            </>
        )
    }
}

export default ShowcaseContainer
